hipShell',1,NULL),(110,'{\"Code\":0,\"Message\":\"获取成功\",\"Data\":[{\"title\":\"为什么患者很容易喜欢上医生？\",\"url\":\"http://dig.chouti.com/pic/show?nid=834376b409e295e7f83f074211551a84\\u0026lid=27446441\"},{\"title\":\"【香港机管局：香港机场所有航班暂停登机】今日下午17点，香港机场管理局发布消息称，受示威者在机场集会影响，客运大楼运转严重受阻，所有航班登机手续已于下午16点30分暂停办理。当天的其它离港及抵港航班将继续运转，航空公司将就未能完成航班登机手续的旅客作出安排。\",\"url\":\"\"},{\"title\":\"前段时间和老公自拍了婚纱照，当初在朋友圈发照片的时候得到了很多好评，刚好最近又比较有空，所以跟大家分享一下我们自拍婚纱照的经验叭~希望能或多或少带给大家一些收获/启发。\",\"url\":\"https://www.douban.com/group/topic/148458876/\"},{\"title\":\"国泰航空“底线测试机”测试成功\",\"url\":\"http://dig.chouti.com/pic/show?nid=d9e8ad79b20658b7d26a8eecd9519c73\\u0026lid=27446551\"},{\"title\":\"第28届中国金鸡百花电影节将于11月19日至23日在厦门举办。该电影节因往年海报给不少网友留下“土味”印象，怒其不争的网友现在就已经开始大声疾呼“救救这只鸡”，并发起#金鸡你太美##金鸡奖民间海报大赛#，邀请各路高手拯救金鸡海报。下图是部分网友的创意（图源见水印)。\",\"url\":\"http://dig.chouti.com/pic/show?nid=8d4c79513acf44fdea5cb10a5afaa091\\u0026lid=27447846\"},{\"title\":\"1991《喜剧明星》谢园、葛优、梁天\",\"url\":\"http://dig.chouti.com/pic/show?nid=bda547a646f8be6f3efaff240d660eed\\u0026lid=27445351\"},{\"title\":\"九连真人在《乐队的夏天》中未正式播出的一首歌《夜游神》，被称作是“连平县少年杀人事件”。他们曾凭借这首歌获得2018年滚石原创乐队大赛冠军，也是乐队的第一首歌，比节目他们表演的所有作品都血腥、残酷、触目惊心且充满杀气，极其有画面感，像是一部充满戏剧张力的电影。\",\"url\":\"https://weibo.com/1344386244/I24unll2S\"},{\"title\":\"@胡锡进：环球时报旗下环球网记者付国豪在香港机场被示威者非法拘押，并遭到非人道的对待。环球时报第一时间与香港警队取得联系，请求救援。香港警队克服巨大困难进入机场，在大约北京时间14日凌晨0点20分许，我们得到消息，香港警队已将付国豪救出。\",\"url\":\"https://weibo.com/1989660417/I25MPBnq2\"},{\"title\":\"这书出版的意义在于？\",\"url\":\"http://dig.chouti.com/pic/show?nid=c15cb276fa722fd27205652aa598914b\\u0026lid=27447571\"},{\"title\":\"【体育经纪人联手娱乐公司，球员出圈赚钱能否驶上快车道】球员的场外生活越来越丰富，投资、影视和音乐等都能成为他们的“副业”，这一点与老一代球员有明显区别。一方面是话语权的增强，另一方面是社交媒体的快速发展让球员们出圈更为容易。在国内，像郭艾伦等球员，也热衷于通过经营社交媒体等，发展自己的“业余生活”。\",\"url\":\"https://mp.weixin.qq.com/s/yendiqmHhvodFp39LYLBJw\"},{\"title\":\"肯尼亚议员放屁太臭导致辩论被迫暂停十分钟\",\"url\":\"http://www.vice.cn/read/a-fart-caused-debate-to-be-suspended-in-the-kenyan-parliament\"},{\"title\":\"过去两年，河南南阳市赵河镇等地多具女性尸体被盗。法院判决书显示，多起被盗女性尸体被卖到山西等地非法“配阴婚”。当地有女性老人过世埋葬后，家人只好装监控或搭棚看守。\",\"url\":\"https://www.thepaper.cn/newsDetail_forward_4150452\"},{\"title\":\"【和重刑犯的7000次谈话】作为重刑犯监区前监区长，工作的十多年里，杨旭东累计与重刑犯开展谈话7000人次以上。即便是重刑犯也有交流的渴望，杨旭东发现，有些重刑犯甚至努力表现得和别人不一样来引起民警的关注，这样能被叫去谈话。\",\"url\":\"http://www.bjnews.com.cn/inside/2019/08/13/614928.html\"},{\"title\":\"皮划艇世界冠军参与内涝救援后说：现场有皮划艇冲锋舟但没有人会开\",\"url\":\"https://www.jiemian.com/article/3402409.html\"},{\"title\":\"【僵尸门店遍地，谁在重塑美国零售业】按照目前门店关闭的速度，美国需要十年时间才能达到接近均衡的水平。自2005年达到顶峰以来，美国百货商场销售额已经下降了33%。与他们的父母相比，千禧一代在体验和经历上花费更多，在具体物品上花费更少。\",\"url\":\"https://mp.weixin.qq.com/s/gqUDX8G8fUvDRYqceCDtKA\"},{\"title\":\"搜索一上马，头条关于公司方面的营销电话开始联系，刚刚给我电话以后的短信。\",\"url\":\"http://dig.chouti.com/pic/show?nid=273637bac528db8b2b7a5139c85a7fcf\\u0026lid=27454861\"},{\"title\":\"仙风盗骨：如何把一个千年信仰推进火坑\",\"url\":\"https://mp.weixin.qq.com/s/M5sVP-nTZVahPnqxzZLYVQ\"},{\"title\":\"草根江湖、垂类生产者和视频朋友圈三种类型的创作者基本上代表了快手的过去和现在，进而能够理解“南抖音北快手”的形成原因和发展脉络。未来值得持续关注的一个问题是，快手上提供内容的三个圈层：草根江湖、垂类创作者、MCN，在未来是会分化还是会走向融合？快手会越来越像抖音吗？\",\"url\":\"https://mp.weixin.qq.com/s/8M6GaDnNKPfboxhf0GbkzA\"},{\"title\":\"【当女明星嫁给了自己的经纪人】李艾以前没想过结婚，也做好了不要孩子的准备，甚至给自己存了一笔冻卵的钱。她一直觉得婚姻和孩子，都不是人生的必选项，直到遇到了张徐宁。结婚5年，共事11年。他们既是夫妻，也是工作拍档。这种特殊关系让他们成为彼此最亲密、也最信任的人。\",\"url\":\"https://mp.weixin.qq.com/s/9Y9h00NqsxbEMW_61_QBgg\"},{\"title\":\"【4000万失能老人的余生由谁照料？】长期护理保险，是指以社会互助共济方式筹集资金，对经评估达到一定护理需求等级的长期失能人员，为其基本生活照料和与基本生活密切相关的医疗护理，提供服务或资金保障的社会保险制度。“享受待遇的参保失能老人与家属都明显感觉到护理费用支出减少，并得到了质量较高的专业服务。”\",\"url\":\"https://mp.weixin.qq.com/s/0qzHT5oNThBzs0D3Kof2GA\"},{\"title\":\"东京都新宿区本周新开了一家别具特色的“2D咖啡厅” (twi:yoshidakaityou)\",\"url\":\"http://dig.chouti.com/pic/show?nid=6210b909b392fb274f18c0c329a20014\\u0026lid=27454881\"},{\"title\":\"FBI昨天突击搜查了爱泼斯坦在加勒比海的私人海岛豪宅，带走了三台电脑。而大统领今天还在继续喷克林顿，说他坐过爱泼斯坦私人飞机27次，去没有去过爱泼斯坦的私人岛，媒体应该去查！反正大统领没去过。摄像今天剪辑这条片说配图好难啊，在网上找了一圈，没有克林顿和爱泼斯坦合照，全是大统领啊\",\"url\":\"http://dig.chouti.com/pic/show?nid=b715d51f693e55a7b102dfd4016e5763\\u0026lid=27454896\"},{\"title\":\"成了女儿奴后，为小朋友花的一点小心思，看起来简单，还是花了不少时间，除了纸板，其他装饰差不多70元。\",\"url\":\"http://dig.chouti.com/pic/show?nid=937420e678f